import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Add an item to cart first (since cart is empty initially)
    await page.waitForSelector('.product-card');
    await page.click('.product-card:first-child');

    // Wait for product modal to appear
    await page.waitForSelector('#productModal', { state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Add to cart
    await page.click('.add-to-cart.large');

    // Wait for notification and close modal
    await page.waitForSelector('.notification.show');
    await page.click('#productModal .close');

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal.png'));

    // Update quantity by clicking the plus button
    await page.click('.cart-item .cart-item-quantity button:nth-child(3)');

    // Wait for quantity to update
    await page.waitForFunction(() => {
      const quantity = document.querySelector('.cart-item .quantity');
      return quantity && quantity.textContent === '2';
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_updated_quantity.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_updated_quantity.png'));

    // Extract updated cart data
    const extractedData = await page.evaluate(() => {
      const item = document.querySelector('.cart-item');
      return {
        productTitle: item?.querySelector('.cart-item-title')?.textContent,
        quantity: item?.querySelector('.quantity')?.textContent,
        price: item?.querySelector('.cart-item-price')?.textContent,
        totalItems: document.getElementById('cartCount')?.textContent
      };
    });

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
